Hi in CSS2.1 spec, why A is defined like this: A  a|\0{0,4}(41|61)(
|[ 	
 ])? while Z is defined like this: Z  z|\0{0,4}(5a|7a)(
|[ 	
 ])?|\z the difference is the last part, why '\z' should be treated as Z but '\a' might not be treated as A? 124\cm is a valid LENGTH token, while 124c\m is not? I have done some testing and it turns out that chars from 'a' to 'f' might not be escaped with '' in CSS why is it so? is it allowed to have Unicode character escapes *anywhere* in the stylesheets? I thought those were allowed only inside strings that's going to complicate tokenizer implementation :/ I think I have an idea I will run the stylesheet through a processor that converts all escapes into regular signs before tokenization it's also lame that comments are allowed everywhere, even between '!' and 'important' what was the point of that? is something like '! /* this is important flag*/ !important' really needed?
